/**
 * @param {number[][]} grid
 * @return {number}
 */
var maxDistance = function(grid) {
	let arr1 = [];
	let N = grid.length;
	let N1 = N - 1;
	for (let i = 0; i < grid.length; i++) {
		for (let j = 0; j < grid[i].length; j++) {
			if (grid[i][j] === 1) arr1.push([i, j]);
		}
	}
	if (arr1.length === N * N || arr1.length == 0) return -1;
	let maxStep = -1;

	function increaseStep(parr, step) {
		let nextXYs = [];
		let x, y;
		let dd = [
			[-1, 0],
			[+1, 0],
			[0, 0 - 1],
			[0, 0 + 1]
		];
		let len = parr.length;
		for (let i = 0; i < len; i++) {
			for (let ii = 0; ii < 4; ii++) {
				let dii = dd[ii];
				let pii = parr[i]
				let nextX = dii[0] + pii[0];
				let nextY = dii[1] + pii[1];
				if (nextX > N1 || nextX < 0 || nextY > N1 || nextY < 0) continue;
				// console.log([nextX, nextY])
				if (grid[nextX][nextY] === 0) {
					grid[nextX][nextY] = step;
					maxStep = step;
					nextXYs.push([nextX, nextY]);
				}
			}
		}
		// console.log(nextXYs)
		// 还可以扩大距离，go on
		if (nextXYs.length) increaseStep(nextXYs, step + 1);
	}
	increaseStep(arr1, 1);
	return maxStep;
};
